import BlogPost from './BlogPost'; 


const  HomePage = ()=>{

    const blogPosts = [
        {
          title: "First Blog Post",
          content: "This is the content of the first blog post. It can contain multiple paragraphs, images, and other elements."
        },
        {
          title: "Second Blog Post",
          content: "This is the content of the second blog post. It can also contain multiple paragraphs, images, and other elements."
        },
        // Add more blog posts as needed
      ];
      return (
        <div className="app">
          {blogPosts.map((post, index) => (
            <BlogPost key={index} title={post.title} content={post.content} />
          ))}
        </div>
      );
}
export default HomePage
